import React, { Component } from 'react'

export default class MobileOprating extends Component {
    render() {
        return (
            <div class="mp">
                <h1 class="text">Mobile Oprating System</h1>
                <ul class="text">
                    <li>Android</li>
                    <li>BlackBerry</li>
                    <li>iphone</li>
                    <li>WindowPhone</li>
                </ul>
            </div>
        )
    }
}
